import { Button, Select, MenuItem } from "@mui/material";
import { Box, Card, Checkbox, FormHelperText } from "@mui/material";
import FlexBetween from "components/flexbox/FlexBetween";
import FlexRowAlign from "components/flexbox/FlexRowAlign";
import AppTextField from "components/input-fields/AppTextField";
import { H1, Paragraph, Small } from "components/Typography";
import { useFormik } from "formik";
import useAuth from "hooks/useAuth";
import { useState } from "react";
import toast from "react-hot-toast";
import { Link, useNavigate } from "react-router-dom";
import * as Yup from "yup";

const Register = () => {
  const { register } = useAuth();
  const navigate = useNavigate();
  const [error, setError] = useState("");
  const [loading, setLoading] = useState(false);
  const initialValues = {
    name: "",
    email: "",
    password: "",
    userType: "", // Add userType field
    terms: true,
    submit: null
  };

  const validationSchema = Yup.object().shape({
    name: Yup.string().required("Name is required"),
    email: Yup.string().email("Must be a valid email").max(255).required("Email is required"),
    password: Yup.string().min(6, "Password should be of minimum 6 characters length").required("Password is required"),
    userType: Yup.string().required("User type is required") // Add validation for userType
  });

  const {
    errors,
    values,
    touched,
    handleBlur,
    handleChange,
    handleSubmit
  } = useFormik({
    initialValues,
    validationSchema,
    onSubmit: async values => {
      setLoading(true);

      try {
        await register(values.email, values.password, values.name);
        setLoading(false);
        toast.success("You registered successfully");
        navigate("/dashboard");
      } catch (error) {
        setError(error?.message);
        setLoading(false);
      }
    }
  });

  return (
    <FlexRowAlign sx={{ flexDirection: "column", height: { sm: "100%" } }}>
      <Card sx={{ padding: 4, maxWidth: 600, boxShadow: 1 }}>
        <FlexRowAlign flexDirection="column" mb={5}>
          <Box width={38} mb={1}>
            <img src="/static/logo/SkinEdu.png" width="100%" alt="Uko Logo" />
          </Box>
          <H1 fontSize={24} fontWeight={700}>
            Get started with SkinEdu
          </H1>
        </FlexRowAlign>

        <form noValidate onSubmit={handleSubmit} style={{ width: "100%" }}>
          <FlexBetween flexWrap="wrap">
            <AppTextField fullWidth name="name" type="text" label="Name" onBlur={handleBlur} onChange={handleChange} value={values.name || ""} error={Boolean(touched.name && errors.name)} helperText={touched.name && errors.name} />

            <AppTextField fullWidth name="email" type="email" label="Email" onBlur={handleBlur} onChange={handleChange} value={values.email || ""} error={Boolean(touched.email && errors.email)} helperText={touched.email && errors.email} />
          </FlexBetween>

          <AppTextField fullWidth name="password" type="password" label="Password" onBlur={handleBlur} onChange={handleChange} value={values.password || ""} error={Boolean(touched.password && errors.password)} helperText={touched.password && errors.password} />

          <Select
            fullWidth
            name="userType"
            value={values.userType}
            onChange={handleChange}
            onBlur={handleBlur}
            error={Boolean(touched.userType && errors.userType)}
          >
            <MenuItem value="">Select User Type</MenuItem>
            <MenuItem value="Medicine Student">Medicine Student</MenuItem>
            <MenuItem value="Medicine Teacher">Medicine Teacher</MenuItem>
          </Select>
          {touched.userType && errors.userType && (
            <FormHelperText error>{errors.userType}</FormHelperText>
          )}

          <FlexRowAlign mt={1} alignItems="center" gap={1}>
            <Checkbox disableRipple checked={values.terms} onChange={handleChange} name="terms" />
            <Paragraph fontWeight={600}>
              I agree to terms & conditions
            </Paragraph>
          </FlexRowAlign>

          {error && <FormHelperText error sx={{ mt: 2, fontSize: 13, fontWeight: 500, textAlign: "center" }}>
              {error}
            </FormHelperText>}

          <Box sx={{ mt: 4 }}>
            {loading ? <Button disabled fullWidth variant="contained">
                Sign Up
              </Button> : <Button fullWidth type="submit" variant="contained">
                Sign Up
              </Button>}
          </Box>
        </form>

        <Paragraph marginLeft="auto" marginRight="auto" mt={2} color="text.disabled">
          Do you already have an account?{" "}
          <Link to="/login" style={{ display: "inline-block" }}>
            <Small color="primary.main">Login</Small>
          </Link>
        </Paragraph>
      </Card>
    </FlexRowAlign>
  );
};

export default Register;
